import styled from 'styled-components';
import './ten.css'
import fence from './fence.png'
import aomsin from './aomsin.png'
import gift from './gift.png'
import fah from './fah.png'
import bom from './bom.png'
import boat from './boat.png'
import toey from './toey.png'
import shepmember from './shepmember.png'
import { Row, Col, Container, Ratio } from 'react-bootstrap'

const Fence = styled.img`
position: absolute;
top: 75%;
left: -1%;
width:1022px; 
height:300px;

`
const Fence1 = styled.img`
position: absolute;
top: 75%;
left: 39%;
width:1022px; 
height:300px;

`
const Fence2 = styled.img`
position: absolute;
top: 75%;
left: 80%;
width:1022px; 
height:300px;

`


const Shepmember = styled.img`
position: absolute;
width:250px; 
height:250px;
left: 5%;
padding: 20px;
box-sizing: border-box;

`
const Shepmember1 = styled.img`
position: absolute;
width:250px; 
height:250px;
left: 20%;
padding: 20px;
box-sizing: border-box;

`
const Shepmember2 = styled.img`
position: absolute;
width:250px; 
height:250px;
left: 35%;
padding: 20px;
box-sizing: border-box;
`
const Shepmember3 = styled.img`
position: absolute;
width:250px; 
height:250px;
left: 50%;
padding: 20px;
box-sizing: border-box;
`
const Shepmember4 = styled.img`
position: absolute;
width:250px; 
height:250px;
left: 65%;
padding: 20px;
box-sizing: border-box;
`
const Shepmember5 = styled.img`
position: absolute;
width:250px; 
height:250px;
left: 80%;
padding: 20px;
box-sizing: border-box;
`

function Pageten() {
    return (

        <div className="contain3" id="member">

            <h1>Member</h1>

            <div class="grid-container">

                {/* <div class="grid-item">asdasd</div> */}
                <Fence src={fence} />
                <Fence1 src={fence} />
                <Fence2 src={fence} />
                <Row style={{ width: "100%" }} >
                    <Col>
                        <Shepmember1 src={aomsin} />
                    </Col>
                    <Col>
                        <Shepmember2 src={gift} />
                    </Col>
                    <Col>
                        <Shepmember3 src={fah} />
                    </Col><Col>
                        <Shepmember4 src={bom} />
                    </Col>

                    <Col>
                        <Shepmember5 src={shepmember} />
                    </Col>

                    <Col>
                        <Shepmember1 src={boat} />
                    </Col>
                    <Col>
                        <Shepmember1 src={toey} />
                    </Col>

                </Row>
                {/* <Shepmember src={shepmember} /> */}
                {/* 
                <div class="grid-item"></div>
                <Shepmember1 src={shepmember} />
                <div class="grid-item"></div>
                <Shepmember2 src={shepmember} />
                <div class="grid-item"></div>
                <Shepmember3 src={shepmember} />
                <div class="grid-item"></div>
                <Shepmember4 src={shepmember} />
                <div class="grid-item"></div>
                <Shepmember5 src={shepmember} /> */}

            </div>
            <div class="grid-container2">

                <div class="grid-item1">Aomsin</div>


                <div class="grid-item1">Gift</div>

                <div class="grid-item1">Fah</div>

                <div class="grid-item1">Bom</div>

                <div class="grid-item1">Boat</div>

                <div class="grid-item1">Toey</div>

            </div>
        </div>


    )


}

const pageTen2 = () => {
    return (
        <div id="member" style={{ width: "100vw", height: "100vh", display: "flex", flexDirection: "column", alignItems: "center", background: "#A5DAE2", justifyContent: "space-between" }} >
            <div>
                <h1> Member </h1>
            </div>
            <div style={{ width: "90vw", display: "grid", gridTemplateColumns: "auto auto auto auto auto auto", gap: "20px" }} >
                <img src={aomsin} style={{ objectFit: "cover", width: "100%" }} />
                <img src={gift} style={{ objectFit: "cover", width: "100%" }} />
                <img src={fah} style={{ objectFit: "cover", width: "100%" }} />
                <img src={bom} style={{ objectFit: "cover", width: "100%" }} />
                <img src={boat} style={{ objectFit: "cover", width: "100%" }} />
                <img src={toey} style={{ objectFit: "cover", width: "100%" }} />
            </div>
            {/* <div style={{ width: "100%" }} >
                <Fence src={fence} />
                <Fence1 src={fence} />
                <Fence2 src={fence} />
            </div> */}
            <div>
                <h1>รั้ว</h1>
            </div>
        </div>
    )
}
export default pageTen2
